import './index.css'

const Body = props => {
  const {TaskDetails} = props
  const {dueOn, status, title, UserId} = TaskDetails
  console.log(status)

  const statusValue =
    status === 'pending' ? (
      <div className="pending">.</div>
    ) : (
      <div className="completed">.</div>
    )
  const date = dueOn.getYear()
  return (
    <tr>
      <td>{title}</td>
      <td>{date}</td>
      <td>{statusValue}</td>
      <td>{UserId}</td>
    </tr>
  )
}
export default Body
